import React from 'react';
import ReactDOM from 'react-dom';

ReactDOM.render(
  [
    <h1>Hello Guy Welcome BrainyDx</h1>,

    <p>You have been shortlisted for the profile of  Jr. Software Engineer at BrainyDX technologies.

      For testing your technical skills, please find attached a task, you requested to do this by Saturday.

      Kindly call Shiv from our team in case of any questions or concerns.
      Shiv can be reached on this number +91 95409 97158</p>,
    <h2>i am Jn.Software developer</h2>,
  ],
  document.getElementById('root')
);
